import { useState } from "react";
import "./App.css";
import AddExpences from "./Components/AddExpences";
import ListExpences from "./Components/ListExpences";

function App() {
  const AddedData = [
    {
      id: "l1",
      date: new Date(2021, 5, 21),
      title: "manoj",
      amount: 220,
    },
    {
      id: "l1",
      date: new Date(2021, 5, 21),
      title: "manoj",
      amount: 220,
    },
  ];
  let [Data, setData] = useState(AddedData);
  const expenceData = (data) => {
    setData = { AddedData, ...data };
  };
  return (
    <div className="App">
      <AddExpences onExpenceData={expenceData} />
      <ListExpences items={Data} />
    </div>
  );
}

export default App;
